INSERT INTO `civicrm_activity` (`id`, `source_record_id`, `activity_type_id`, `subject`, `activity_date_time`, `duration`, `location`, `phone_id`, `phone_number`, `details`, `status_id`, `priority_id`, `parent_id`, `is_test`, `medium_id`, `is_auto`, `relationship_id`, `is_current_revision`, `original_id`, `result`, `is_deleted`, `campaign_id`, `engagement_level`, `weight`, `is_star`, `created_date`, `modified_date`) VALUES (264,NULL,44,NULL,'2018-03-27 15:58:02',NULL,NULL,NULL,NULL,'Mycodelic Forest: Why 1.5 Hours Before Hand? \r\n\r\nWhen you open the purchase link before the sale, you are dropped into a que. Users are supposed to be randomly assigned numbers from this que when the sale opens -- but things have not always worked like that. In 2016 some users who were in that que wound up getting moved to the front of the line instead of getting a random number.\r\n\r\nWe recommend an abundance of caution.',2,2,NULL,0,NULL,0,NULL,1,NULL,'SM01c17a12aa534801bcffd34f0c658018',0,NULL,NULL,NULL,0,'2018-03-27 20:58:02','2018-03-27 20:58:02');
